ión fallido con correo correcto pero contraseña incorrecta\r\n    Given navego a la URL \"https:\/\/taskhub.cl\/\"\r\n    When ingreso en el campo de nombre de usuario con id \"email\" el texto \"igna.veliz@duocuc.cl\"\r\n    And ingreso en el campo de contraseña con id \"password\" el texto \"incorrect_password\"\r\n    And hago clic en el botón de inicio de sesión con id \"login_button\"\r\n    Then debería permanecer en la URL \"https:\/\/taskhub.cl\/\"\r\n\r\n  Scenario: Inicio de sesión fallido con correo incorrecto pero contraseña correcta\r\n    Given navego a la URL \"https:\/\/taskhub.cl\/\"\r\n    When ingreso en el campo de nombre de usuario con id \"email\" el texto \"incorrect_email@example.com\"\r\n    And ingreso en el campo de contraseña con id \"password\" el texto \"123123123\"\r\n    And hago clic en el botón de inicio de sesión con id \"login_button\"\r\n    Then debería permanecer en la URL \"https:\/\/taskhub.cl\/\"\r\n\r\n  Scenario: Inicio de sesión fallido con correo y contraseña incorrectos\r\n    Given navego a la URL \"https:\/\/taskhub.cl\/\"\r\n    When ingreso en el campo de nombre de usuario con id \"email\" el texto \"incorrect_email@example.com\"\r\n    And ingreso en el campo de contraseña con id \"password\" el texto \"incorrect_password\"\r\n    And hago clic en el botón de inicio de sesión con id \"login_button\"\r\n    Then debería permanecer en la URL \"https:\/\/taskhub.cl\/\"\r\n\r\n  Scenario: Inicio de sesión fallido con el campo de correo vacío\r\n    Given navego a la URL \"https:\/\/taskhub.cl\/\"\r\n    When ingreso en el campo de nombre de usuario con id \"email\" el texto \"\"\r\n    And ingreso en el campo de contraseña con id \"password\" el texto \"123123123\"\r\n    And hago clic en el botón de inicio de sesión con id \"login_button\"\r\n    Then debería permanecer en la URL \"https:\/\/taskhub.cl\/\"\r\n\r\n  Scenario: Inicio de sesión fallido con correo correcto pero contraseña vacía\r\n    Given navego a la URL \"https:\/\/taskhub.cl\/\"\r\n    When ingreso en el campo de nombre de usuario con id \"email\" el texto \"igna.veliz@duocuc.cl\"\r\n    And ingreso en el campo de contraseña con id \"password\" el texto \"\"\r\n    And hago clic en el botón de inicio de sesión con id \"login_button\"\r\n    Then debería permanecer en la URL \"https:\/\/taskhub.cl\/\"\r\n\r\n  Scenario: Inicio de sesión fallido con ambos campos vacíos\r\n    Given navego a la URL \"https:\/\/taskhub.cl\/\"\r\n    When ingreso en el campo de nombre de usuario con id \"email\" el texto \"\"\r\n    And ingreso en el campo de contraseña con id \"password\" el texto \"\"\r\n    And hago clic en el botón de inicio de sesión con id \"login_button\"\r\n    Then debería permanecer en la URL \"https:\/\/taskhub.cl\/\"\r\n\r\n  Scenario: Inicio de sesión fallido con intento de inyección SQL\r\n    Given navego a la URL \"https:\/\/taskhub.cl\/\"\r\n    When ingreso en el campo de nombre de usuario con id \"email\" el texto \"' OR '1'='1\"\r\n    And ingreso en el campo de contraseña con id \"password\" el texto \"' OR '1'='1\"\r\n    And hago clic en el botón de inicio de sesión con id \"login_button\"\r\n    Then debería permanecer en la URL \"https:\/\/taskhub.cl\/\"\r\n","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:\/\/\/C:\/Users\/ignac\/OneDrive\/Documents\/GitHub\/PruebasTaskhub\/src\/test\/resources\/feature\/EscenarioLogin.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"Inicio de sesión de usuario","description":"","children":[{"scenario":{"location":{"line":3,"column":3},"tags":[],"keyword":"Scenario","name":"Inicio de sesión exitoso con correo y contraseña correctos","description":"","steps":[{"location":{"line":4,"column":5},"keyword":"Given ","keywordType":"Context","text":"navego a la URL \"https:\/\/taskhub.cl\/\"","id":"4039695d-877b-4611-8bc6-51340dc16a5e"},{"location":{"line":5,"column":5},"keyword" l campo con id \"password\" con el texto \"123123123\"\r\n    And Hacer clic en el botón con id \"login_button\"\r\n    Then Verificar que estamos en la página de inicio \"https:\/\/taskhub.cl\/inicio\"\r\n\r\n  Scenario: Modificar el nombre de un proyecto existente\r\n    When Hacer clic en el botón de navegación con id \"menu-proyectos\"\r\n    Then Verificar que ingresamos a la vista de proyectos \"https:\/\/taskhub.cl\/proyecto\"\r\n    When Seleccionar el proyecto con nombre \"Nescafessss\" y hacer clic en \"btn-editar-1\"\r\n    Then Verificar que ingresamos a la vista de edición del proyecto \"https:\/\/taskhub.cl\/proyecto\/edit\/1\"\r\n    And Cambiar el nombre del proyecto con id \"nombre\" al texto \"Proyecto modificado\"\r\n    When Hacer clic en el botón de guardar con id \"btn-guardar-proyecto\"\r\n    Then Verificar que aparece el mensaje de éxito \"Proyecto modificado exitosamente\" en el elemento \"swal2-title\"\r\n    And Aceptar la alerta\r\n    Then Verificar que el proyecto se actualizó con el nombre \"Proyecto modificado\"\r\n    And Verificar que llegamos a la vista del proyecto para modificar con la URL que contiene \"show\"\r\n\r\n  Scenario: Modificar el tipo de un proyecto existente\r\n    When Hacer clic en el botón de navegación con id \"menu-proyectos\"\r\n    Then Verificar que ingresamos a la vista de proyectos \"https:\/\/taskhub.cl\/proyecto\"\r\n    When Seleccionar el proyecto con nombre \"Nescafessss\" y hacer clic en \"btn-editar-1\"\r\n    Then Verificar que ingresamos a la vista de edición del proyecto \"https:\/\/taskhub.cl\/proyecto\/edit\/1\"\r\n    And Seleccionar la opcion \"2\" del selector con id \"tipo_proyecto_id\"\r\n    When Hacer clic en el botón de guardar con id \"btn-guardar-proyecto\"\r\n    Then Verificar que aparece el mensaje de éxito \"Proyecto modificado exitosamente\" en el elemento \"swal2-title\"\r\n    And Aceptar la alerta\r\n    Then Verificar que el tipo de proyecto se actualizó a \"Interno\"\r\n    And Verificar que llegamos a la vista del proyecto para modificar con la URL que contiene \"show\"\r\n\r\n  Scenario: Modificar el jefe de un proyecto existente\r\n    When Hacer clic en el botón de navegación con id \"menu-proyectos\"\r\n    Then Verificar que ingresamos a la vista de proyectos \"https:\/\/taskhub.cl\/proyecto\"\r\n    When Seleccionar el proyecto con nombre \"Nescafessss\" y hacer clic en \"btn-editar-1\"\r\n    Then Verificar que ingresamos a la vista de edición del proyecto \"https:\/\/taskhub.cl\/proyecto\/edit\/1\"\r\n    And Seleccionar la opcion \"2\" del selector con id \"jefe_proyecto_id\"\r\n    When Hacer clic en el botón de guardar con id \"btn-guardar-proyecto\"\r\n    Then Verificar que aparece el mensaje de éxito \"Proyecto modificado exitosamente\" en el elemento \"swal2-title\"\r\n    And Aceptar la alerta\r\n    Then Verificar que el jefe de proyecto se actualizó a \"Alessandro Halvorson\"\r\n    And Verificar que llegamos a la vista del proyecto para modificar con la URL que contiene \"show\"\r\n\r\n  Scenario: Modificar el la fecha de un proyecto existente\r\n    When Hacer clic en el botón de navegación con id \"menu-proyectos\"\r\n    Then Verificar que ingresamos a la vista de proyectos \"https:\/\/taskhub.cl\/proyecto\"\r\n    When Seleccionar el proyecto con nombre \"Nescafessss\" y hacer clic en \"btn-editar-1\"\r\n    Then Verificar que ingresamos a la vista de edición del proyecto \"https:\/\/taskhub.cl\/proyecto\/edit\/1\"\r\n    And Modificar la fecha con el campo \"daterange\" del proyecto a \"25\/11\/2024 - 30\/11\/2024\"\r\n    When Hacer clic en el botón de guardar con id \"btn-guardar-proyecto\"\r\n    Then Verificar que aparece el mensaje de éxito \"Proyecto modificado exitosamente\" en el elemento \"swal2-title\"\r\n    And Aceptar la alerta\r\n    Then Verificar que fecha de inicio proyecto se actualizó a \"2024-11-25\"\r\n    Then Verificar que fecha de termino proyecto se actualizó a \"2024-11-30\"\r\n    An
